export default {
    state: {
        notes: [{
                title: "First note",

                description: "Description for first note",

                date: new Date(Date.now()).toLocaleString(),

                message: null,

                priority: "",

                highPriority: false,

                mediumPriority: false,

                lowPriority: false
            },
            {
                title: "Second note",

                description: "Description for Second note",

                date: new Date(Date.now()).toLocaleString(),

                message: null,

                priority: "",

                highPriority: false,

                mediumPriority: false,

                lowPriority: false
            },
            {
                title: "Third note",

                description: "Description for Third note",

                date: new Date(Date.now()).toLocaleString(),

                message: null,

                priority: "",

                highPriority: false,

                mediumPriority: false,

                lowPriority: false
            }
        ]
    },
    mutations: {
        pushNewNote(state, payload) {
            state.notes.push(payload)
            payload.message = ""
        }
    },
    actions: {
        pushNewNote({ commit }, payload) {
            commit('pushNewNote', payload)
        }
    },
    getters: {
        getNoteList(state) {
            return state.notes
        }

    },
}
